webpackJsonp([0xcfe3249fa4df],{439:function(e,a){e.exports={data:{markdownRemark:{html:'<p>As a developer you always have to adjust and use IDE’s that will help you be more productive, as for me, i’m a netbeans junkie, been using it for a while now, especially for Java development.</p>\n<p>A few months back I started using Atom for some Ruby projects, and since then I felt in love with it, the clean layout and simplicity of it, being open source just gave it the necessary push, and if you like to customize you IDE, like me!!, it has a great list of plugins and themes..</p>\n<p>During my time using it I’ve come to install a few plugins that have helped me oin my day to day development workflow.</p>\n<h2><a href="https://atom.io/packages/emmet">EMMET</a></h2>\n<p>Emmet seems to be a plugin that you need to install, whatever your text editor environment is. The main features of Emmet such as expanding abbreviations and wrapping with abbreviations, allow you to work quickly when writing HTML, CSS, Sass / SCSS and LESS syntaxes. For example, in HTML, type <code>language:html p>a.mylink</code> then tap on TAB key to get a complete HTML tag <code>&#x3C;p>&#x3C;a href class="mylink">&#x3C;/a>&#x3C;/p></code>.The Cheat Sheet will helps you to quickly learn Emmet’s abbreviation syntax.</p>\n<p><a href="http://media02.hongkiat.com/useful-atom-packages/emmet.gif"></a></p>',frontmatter:{path:"/atom-packages",title:"USEFUL ATOM PACKAGES",date:"September 04, 2016",tags:["atom","packages","ide"],author:{id:"Phanor Coll",bio:"Fullstack developer from Merida, Venezuela."}}}},pathContext:{}}}});
